import React from 'react';
import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
} from '../Components/NavbarElements';

const Navbar = () => {
  return (
    <>
      <Nav>
        <Bars />
        <NavMenu>
          <NavLink to='/LandingPage' activeStyle>
            Home
          </NavLink>
          <NavLink to='/AboutPage' activeStyle>
            About
          </NavLink>
          <NavLink to='/FolioPage' activeStyle>
            Portefolio
          </NavLink>
          <NavLink to='/ContactPage' activeStyle>
            Contact Me
          </NavLink>
        </NavMenu>
      </Nav>
    </>
  );
};

export default Navbar;
